import React, { useState } from 'react';

const TestCasePanel = ({ testCases, activeTestCase, onTestCaseChange, isDarkMode }) => {
  const [selectedTab, setSelectedTab] = useState(0);

  const handleTabClick = (index) => {
    setSelectedTab(index);
    onTestCaseChange(index);
  };

  return (
    <div className={`flex flex-col h-full ${isDarkMode ? 'bg-[#1a1a1a] text-[#cccccc]' : 'bg-white text-gray-800'}`}>
      {/* Test Case Tabs */}
      <div className="flex items-center border-b border-[#2d2d2d] bg-[#282828] p-2">
        <div className="flex space-x-1 overflow-x-auto">
          {testCases.map((_, index) => (
            <button
              key={index}
              onClick={() => handleTabClick(index)}
              className={`px-4 py-2 rounded-t-lg text-sm font-medium transition-colors duration-150 
                ${selectedTab === index 
                  ? 'bg-[#404040] text-[#cccccc]' 
                  : 'bg-[#333333] text-[#8c8c8c] hover:bg-[#404040] hover:text-[#cccccc]'}`}
            >
              Case {index + 1}
            </button>
          ))}
          <button
            className="px-4 py-2 rounded-t-lg text-sm font-medium bg-[#333333] text-[#8c8c8c] hover:bg-[#404040] hover:text-[#cccccc]"
          >
            +
          </button>
        </div>
      </div>

      {/* Test Case Content */}
      <div className="flex-1 p-4 space-y-4 overflow-y-auto">
        {testCases[selectedTab] && Object.entries(testCases[selectedTab].input_params || {}).map(([param, value]) => (
          <div key={param} className="space-y-2">
            <label className="block text-sm font-medium text-[#8c8c8c]">
              {param} =
            </label>
            <input
              type="text"
              value={value}
              readOnly
              className="w-full px-3 py-2 bg-[#282828] border border-[#404040] rounded-md text-[#cccccc] focus:outline-none focus:ring-2 focus:ring-[#505050]"
            />
          </div>
        ))}
      </div>
    </div>
  );
};

export default TestCasePanel;
